    <p>{`The Vector `}<inlineCode parentName="p">{`logfmt_parser`}</inlineCode>{` transform
accepts and outputs `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}><inlineCode parentName="a">{`log`}</inlineCode></a>{` events, allowing you to parse
a log field's value in the `}<a parentName="p" {...{
        "href": "https://brandur.org/logfmt"
      }}>{`logfmt`}</a>{` format.`}</p>
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/reference/transforms/logfmt_parser.md.erb
      */
    }
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <Tabs block={true} defaultValue="common" values={[{
      "label": "Common",
      "value": "common"
    }, {
      "label": "Advanced",
      "value": "advanced"
    }]} mdxType="Tabs">
      <TabItem value="common" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.my_transform_id]
  # General
  type = "logfmt_parser" # required
  inputs = ["my-source-or-transform-id"] # required
  drop_field = true # optional, default
  field = "message" # optional, default

  # Types
  types.status = "int" # example
  types.duration = "float" # example
  types.success = "bool" # example
  types.timestamp = "timestamp|%F" # example
  types.timestamp = "timestamp|%a %b %e %T %Y" # example
  types.parent.child = "int" # example
`}</code></pre>
      </TabItem>
      <TabItem value="advanced" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.my_transform_id]
  # General
  type = "logfmt_parser" # required
  inputs = ["my-source-or-transform-id"] # required
  drop_field = true # optional, default
  field = "message" # optional, default

  # Types
  types.status = "int" # example
  types.duration = "float" # example
  types.success = "bool" # example
  types.timestamp = "timestamp|%F" # example
  types.timestamp = "timestamp|%a %b %e %T %Y" # example
  types.parent.child = "int" # example
`}</code></pre>
      </TabItem>
    </Tabs>
    <Fields filters={true} mdxType="Fields">
      <Field common={true} defaultValue={true} enumValues={null} examples={[true, false]} groups={[]} name={"drop_field"} path={null} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "drop_field"
        }}>{`drop_field`}</h3>
        <p>{`If the specified `}<a parentName="p" {...{
            "href": "#field"
          }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` should be dropped (removed) after parsing.`}</p>
      </Field>
      <Field common={true} defaultValue={"message"} enumValues={null} examples={["message", "parent.child", "array[0]"]} groups={[]} name={"field"} path={null} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "field"
        }}>{`field`}</h3>
        <p>{`The log field to parse.
See `}<a parentName="p" {...{
            "href": "#field-notation-syntax"
          }}>{`Field Notation Syntax`}</a>{` and `}<a parentName="p" {...{
            "href": "#format-specification"
          }}>{`Format Specification`}</a>{` for more info.`}</p>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"types"} path={null} relevantWhen={null} required={false} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "types"
        }}>{`types`}</h3>
        <p>{`Key/value pairs representing mapped log field names and types. This is used to
coerce log fields into their proper types.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={null} enumValues={{
            "bool": "Coerces `\"true\"`/`/\"false\"`, `\"1\"`/`\"0\"`, and `\"t\"`/`\"f\"` values into boolean.",
            "float": "Coerce to a 64 bit float.",
            "int": "Coerce to a 64 bit integer.",
            "string": "Coerce to a string.",
            "timestamp": "Coerces to a Vector timestamp. [`strptime` specificiers][urls.strptime_specifiers] must be used to parse the string."
          }} examples={[{
            "status": "int"
          }, {
            "duration": "float"
          }, {
            "success": "bool"
          }, {
            "timestamp": "timestamp|%F"
          }, {
            "timestamp": "timestamp|%a %b %e %T %Y"
          }, {
            "parent": {
              "child": "int"
            }
          }]} groups={[]} name={"`[field-name]`"} path={"types"} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "field-name"
            }}><inlineCode parentName="h4">{`[field-name]`}</inlineCode></h4>
            <p>{`A definition of log field type conversions. They key is the log field name and
the value is the type. `}<a parentName="p" {...{
                "href": "https://docs.rs/chrono/0.4.11/chrono/format/strftime/index.html#specifiers"
              }}><inlineCode parentName="a">{`strptime`}</inlineCode>{` specifiers`}</a>{` are
supported for the `}<inlineCode parentName="p">{`timestamp`}</inlineCode>{` type.`}</p>
          </Field>
        </Fields>
      </Field>
    </Fields>
    <h2 {...{
      "id": "examples"
    }}>{`Examples`}</h2>
    <Tabs block={true} defaultValue="heroku-router-log" select={false} values={[{
      "label": "Heroku Router Log",
      "value": "heroku-router-log"
    }, {
      "label": "Loosely Structured",
      "value": "loosely-structured"
    }]} mdxType="Tabs">
      <TabItem value="heroku-router-log" mdxType="TabItem">
        <p>{`Given the following Heroku router log line:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-json",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  "message": "at=info method=GET path=/ host=myapp.herokuapp.com request_id=8601b555-6a83-4c12-8269-97c8e32cdb22 fwd="204.204.204.204" dyno=web.1 connect=1ms service=18ms status=200 bytes=13 tls_version=tls1.1 protocol=http"
}
`}</code></pre>
        <p>{`And the following configuration:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.<transform-id>]
type = "logfmt"
field = "message"
drop_field = true

types.bytes = "int"
types.status = "int"
`}</code></pre>
        <p>{`A `}<a parentName="p" {...{
            "href": "/docs/about/data-model/log/"
          }}><inlineCode parentName="a">{`log`}</inlineCode>{` event`}</a>{` will be output with the following structure:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  // ... existing fields
  "at": "info",
  "method": "GET",
  "path": "/",
  "host": "myapp.herokuapp.com",
  "request_id": "8601b555-6a83-4c12-8269-97c8e32cdb22",
  "fwd": "204.204.204.204",
  "dyno": "web.1",
  "connect": "1ms",
  "service": "18ms",
  "status": 200,
  "bytes": 13,
  "tls_version": "tls1.1",
  "protocol": "http"
}
`}</code></pre>
        <p>{`A couple of things to note:`}</p>
        <ol>
          <li parentName="ol">{`The `}<inlineCode parentName="li">{`bytes`}</inlineCode>{` and `}<inlineCode parentName="li">{`status`}</inlineCode>{` fields were coerced into `}<inlineCode parentName="li">{`int`}</inlineCode>{`s via the `}<a parentName="li" {...{
              "href": "#types"
            }}><inlineCode parentName="a">{`types`}</inlineCode></a>{` options.`}</li>
          <li parentName="ol">{`The `}<inlineCode parentName="li">{`message`}</inlineCode>{` field was dropped due to setting `}<a parentName="li" {...{
              "href": "#drop_field"
            }}><inlineCode parentName="a">{`drop_field`}</inlineCode></a>{` to `}<inlineCode parentName="li">{`true`}</inlineCode>{`.`}</li>
        </ol>
      </TabItem>
      <TabItem value="loosely-structured" mdxType="TabItem">
        <p>{`The `}<inlineCode parentName="p">{`logfmt_parser`}</inlineCode>{` will also parse loosely structured key/value pairs. For
example, given the following `}<inlineCode parentName="p">{`log`}</inlineCode>{` event:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-json",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  "message": "info | Sent 200 in 54.2ms duration=54.2ms status=200"
}
`}</code></pre>
        <p>{`And the following configuration:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.<transform-id>]
type = "logfmt"
field = "message"
drop_field = false # keep the field since it contains other data

types.status = "int"
`}</code></pre>
        <p>{`A `}<a parentName="p" {...{
            "href": "/docs/about/data-model/log/"
          }}><inlineCode parentName="a">{`log`}</inlineCode>{` event`}</a>{` will be output with the following structure:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  // ... existing fields
  "message": "info | Sent 200 in 54.2ms duration=54.2ms status=200",
  "duration": "54.2ms",
  "status": 200
}
`}</code></pre>
        <p>{`A couple of things to note:`}</p>
        <ol>
          <li parentName="ol">{`The `}<inlineCode parentName="li">{`status`}</inlineCode>{` field was coerced into an `}<inlineCode parentName="li">{`int`}</inlineCode>{` via the `}<a parentName="li" {...{
              "href": "#types"
            }}><inlineCode parentName="a">{`types`}</inlineCode></a>{` option.`}</li>
          <li parentName="ol">{`The `}<inlineCode parentName="li">{`message`}</inlineCode>{` field was `}<em parentName="li">{`kept`}</em>{` due to setting `}<a parentName="li" {...{
              "href": "#drop_field"
            }}><inlineCode parentName="a">{`drop_field`}</inlineCode></a>{` to `}<inlineCode parentName="li">{`false`}</inlineCode>{`.`}</li>
        </ol>
      </TabItem>
    </Tabs>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "complex-processing"
    }}>{`Complex Processing`}</h3>
    <p>{`If you encounter limitations with the `}<inlineCode parentName="p">{`logfmt_parser`}</inlineCode>{`
transform then we recommend using a `}<a parentName="p" {...{
        "href": "https://vector.dev/components/?functions%5B%5D=program"
      }}>{`runtime transform`}</a>{`.
These transforms are designed for complex processing and give you the power of
full programming runtime.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "field-notation-syntax"
    }}>{`Field Notation Syntax`}</h3>
    <p>{`The `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` options
support `}<a parentName="p" {...{
        "href": "/docs/reference/field-path-notation/"
      }}>{`Vector's field notation syntax`}</a>{`,
enabling access to root-level, nested, and array field values. For example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`[transforms.my_logfmt_parser_transform_id]
  # ...
  field = "message"
  field = "parent.child"
  field = "array[0]"
  # ...
`}</code></pre>
    <p>{`You can learn more about Vector's field notation in the
`}<a parentName="p" {...{
        "href": "/docs/reference/field-path-notation/"
      }}>{`field notation reference`}</a>{`.`}</p>
    <h3 {...{
      "id": "format-specification"
    }}>{`Format Specification`}</h3>
    <p><a parentName="p" {...{
        "href": "https://brandur.org/logfmt"
      }}>{`Logfmt`}</a>{` is, unfortunately, a very loosely defined format. There
is no official specification for the format and Vector makes a best effort to
parse key/value pairs delimited with a `}<inlineCode parentName="p">{`=`}</inlineCode>{`. It works by splitting the `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{`'s
value on non-quoted white-space and then splitting each token by a non-quoted
`}<inlineCode parentName="p">{`=`}</inlineCode>{` character. This makes the parsing process somewhat flexible in that the
string does not need to be strictly formatted.`}</p>
    <p>{`For example, the following log line:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-js",
        "metastring": "title=\"log event\"",
        "title": "\"log",
        "event\"": true
      }}>{`{
  "message": "Hello world duration=2s user-agent=\\"Firefox/47.3 Mozilla/5.0\\""
}
`}</code></pre>
    <p>{`Will be successfully parsed into:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-js",
        "metastring": "title=\"log event\"",
        "title": "\"log",
        "event\"": true
      }}>{`{
  "message": "Hello world duration=2s user-agent=\\"Firefox/47.3 Mozilla/5.0\\"",
  "duration": "2s",
  "user-agent": "Firefox/47.3 Mozilla/5.0"
}
`}</code></pre>
    <h3 {...{
      "id": "keyvalue-parsing"
    }}>{`Key/Value Parsing`}</h3>
    <p>{`This transform can be used for key/value parsing. `}<a parentName="p" {...{
        "href": "https://brandur.org/logfmt"
      }}>{`Logfmt`}</a>{` refers
to a `}<em parentName="p">{`loosely`}</em>{` defined spec that parses a key/value pair delimited by a `}<inlineCode parentName="p">{`=`}</inlineCode>{`
character. This section, and it's keywords, is primarily added to assist users
in finding this transform for these terms.`}</p>
    <h3 {...{
      "id": "quoting-values"
    }}>{`Quoting Values`}</h3>
    <p>{`Values can be quoted to capture spaces, and quotes can be escaped with `}<inlineCode parentName="p">{`\\`}</inlineCode>{`.
For example`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`key1="value with spaces" key2="value with spaces and \\""
`}</code></pre>
    <p>{`Would result in the following `}<inlineCode parentName="p">{`log`}</inlineCode>{` event:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-json",
        "metastring": "title=\"log event\"",
        "title": "\"log",
        "event\"": true
      }}>{`{
  "key1": "value with spaces",
  "key2": "value with spaces and \\""
}
`}</code></pre>
    <h3 {...{
      "id": "value-coercion"
    }}>{`Value Coercion`}</h3>
    <p>{`Values can be coerced upon extraction via the `}<a parentName="p" {...{
        "href": "#types"
      }}><inlineCode parentName="a">{`types.*`}</inlineCode></a>{` options. This functions
exactly like the `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/coercer/"
      }}><inlineCode parentName="a">{`coercer`}</inlineCode>{` transform`}</a>{` except that its
coupled within this transform for convenience.`}</p>
    <h4 {...{
      "id": "timestamps"
    }}>{`Timestamps`}</h4>
    <p>{`You can coerce values into timestamps via the `}<inlineCode parentName="p">{`timestamp`}</inlineCode>{` type:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`# ...
types.first_timestamp = "timestamp" # best effort parsing
types.second_timestamp = "timestamp|%Y-%m-%dT%H:%M:%S%z" # ISO8601
# ...
`}</code></pre>
    <p>{`As noted above, if you do not specify a specific `}<inlineCode parentName="p">{`strftime`}</inlineCode>{` format, Vector
will make a best effort attempt to parse the timestamp against the following
common formats:`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Format`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><strong parentName="td">{`Without Timezone`}</strong></td>
          <td parentName="tr" {...{
            "align": "left"
          }}></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`%F %T`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`YYYY-MM-DD HH:MM:SS`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`%v %T`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`DD-Mmm-YYYY HH:MM:SS`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`FT%T`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`ISO 8601 / RFC 3339 without TZ`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`m/%d/%Y:%T`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`US common date format`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`a, %d %b %Y %T`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`RFC 822/2822 without TZ`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`a %d %b %T %Y`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`date`}</inlineCode>{` command output without TZ`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`A %d %B %T %Y`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`date`}</inlineCode>{` command output without TZ, long names`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
